import React from 'react';
import Dropdown from './Dropdown';
import { NavLink , Link } from 'react-router-dom';
import Bbc from '../link-component/Bbc';

function List(props) {
    return (
        <ul className="navbar-nav mr-auto">
            <li className="nav-item">
            <Link to="/bbc">Bbc</Link>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="#"><h6 className="colour">AL-JAZEERA-ENGLISH</h6></a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="#"><h6 className="colour">SPORTS</h6></a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="#"><h6 className="colour">POLITICES</h6></a>
            </li>
        </ul>
    )
}
export default List;
